import React from "react";
import styled from "styled-components";

const TimerWrapper = styled.h1`
  position: relative;
  width: 300px;
  color: #f05550;
`;


const Timer = ({ ...props }) => {
  const { second } = this.state;
  return (
    <TimerWrapper {...props}>
        TOMATO 25:00 {second}
    </TimerWrapper>
  );
};
export default Timer;
